import React, { useEffect, useState } from "react";
import { Card, Input, Select, Button, Form } from "antd";
import { CheckCircleTwoTone } from "@ant-design/icons";
import { reducer, fetchUsers } from "../others/asyncAction";
import store from "../redux/store";
import { AppInput } from "./UserDetail.style";
const APIIntegration = () => {
  const [user, setUser] = useState({
    firstName: "",
    middleName: "",
    lastName: "",
    tenantId: "",
    cardType: "",
    gender: "",
    email: "",
    contactNumber: "",
    status: "",
    roleId: "",
    firebaseId: "",
    password: "",
    address: {
      address1: "",
      address2: "",
      country: "",
      state: "",
      city: "",
    },
  });

  return (
    <div
    style={{
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      height: "100vh",
    }}
  >
    <Card
      hoverable
      borderd={true}
      style={{
        backgroundImage: "linear-gradient(to right,white,skyblue)",
        width: 600,
        height: 700,
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    > <Form style={{width:400}}><h1>SIGN UP</h1>
           <Form.Item
            label="firstName:"
            labelCol={{ span: 5 }}
            wrapperCol={{ span: 19 }}
          >
            <AppInput
              placeholder="FirstName"
              name="firstName"
              //onChange={onChange}
            />
          </Form.Item>
          <Form.Item
            label="middleName"
            labelCol={{ span: 5 }}
            wrapperCol={{ span: 19 }}
          >
            <AppInput
              placeholder="middleName"
              name="middleName"
              //onChange={onChange}
            />
          </Form.Item>
          <Form.Item
            label="lastName"
            labelCol={{ span: 5 }}
            wrapperCol={{ span: 19 }}
          >
            <AppInput
              placeholder="LastName"
              name="lastName"
              //onChange={onChange}
            />
          </Form.Item>
            </Form>
      </Card>
    </div>
  );
};
export default APIIntegration;

